import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";

// üß© Import Bootstrap and your custom dark theme
import "bootstrap/dist/css/bootstrap.min.css";
import "./styles/custom-bootstrap-theme.css"; // your dark navy theme

// Optional: Global CSS for minor tweaks
import "./index.css";

// üß≠ If you have authentication context (keep it), else remove it
import { AuthProvider } from "./context/AuthContext"; // optional - only if defined

// üß± Create React root
const root = ReactDOM.createRoot(document.getElementById("root"));

// üèÅ Render app
root.render(
  <React.StrictMode>
    {/* You can keep BrowserRouter inside App now, so you don't need it here again */}
    <AuthProvider>
      <App />
    </AuthProvider>
  </React.StrictMode>
);


//Helps detect bugs in development / React.StrictMode
//Enables page routing/navigation /BrowserRouter
//Provides authentication state and logic /AuthProvider
